$(window).on('scroll', function() {
 	if (location.pathname == '/') {
        var boxLocTop = $('.box')[0].getBoundingClientRect().top;
        var circleLocTop = $('.circle')[0].getBoundingClientRect().top;
        
        if ((window.innerHeight + window.scrollY) >= (boxLocTop + window.scrollY)) {
            if ((window.innerHeight + window.scrollY) >= (circleLocTop + window.scrollY)) {
                $('.circle').addClass('expanded').circleAnimation();
            }
        
            $('.icon').addClass('animate');
        }
    }
    if ($('.video-container1')[0].getBoundingClientRect().bottom < window.innerHeight/1.15) {
        turnOffEditingTools();
    }
    $('.video-container1').on('click', function() {
        if (document.body.className.match(/editing-tools-active/) && typeof event.target.className == 'string' && event.target.className.match(/newVideomask/)) {
            turnOffEditingTools();
        }
    });
    if (window.scrollY > 0) {
        $('header').removeClass('transparent-nav');
    } else if (window.scrollY == 0) {
    	if ($('header').hasClass('html5-video-bkgrnd')) {
        	$('header').addClass('transparent-nav');
        }
    }
});
function turnOffEditingTools() {
    $('body').removeClass('editing-tools-active');
    $('.video-editing-popup').removeClass('expanded');
}
function toggleEditingTools() {
    $('.video-editing-popup').toggleClass('expanded');
    $('body').toggleClass('editing-tools-active');
}
