$.fn.circleAnimation = function () {
  var $container = $('.circle');

  function  animateCircle (e) {
    var $circles = $container.find('.circle__item');

    $circles.each(function(i, elm) {
      $(elm).find('.circle__line').css('animation', 'dash'+ (i + 1) +' 1s '+ (i / 2) +'s ease forwards');
    });
  }
  animateCircle();
}
function showLoader() {
    $('#mask').css('display', 'block');
    $('.loader').css('display', 'block');
}
function hideLoader() {
    $(".loader").delay(300).fadeOut();
    $("#mask").delay(600).fadeOut();
}
function videoSlider(e) {
    $('.sliderIcon.active').removeClass('active');
    e.target.classList.add('active');
    
    var clicked = $('.sliderIcon').index(e.target);
    if ($('.videoGallery video').length > 0) {
        var videoSelected = $('.videoGallery video').get(clicked);
        if (videoSelected.readyState != 4) {
            // showLoader();
            videoSelected.addEventListener('canplay', readyToPlayVid);
            videoSelected.load();
        }
        else {
            videoSelected.play().catch(e => console.log(e));
        }
    }
    
    $('.videoGallery').css('left', (100 * -clicked) + 'vw');
}
function readyToPlayVid(e) {
    // hideLoader();
    e.currentTarget.play().catch(e => console.log(e));
    e.currentTarget.removeEventListener('canplay', readyToPlayVid);
}

