var sliders = document.querySelectorAll('.slider');
var buttons = document.querySelectorAll('.button');

buttons.forEach(function(elem) {
    elem.addEventListener('click', buttonClick);
});
sliders.forEach(function(elem) {
    elem.addEventListener('input', sliderChange);
    elem.addEventListener('change', closeButton);
});

function buttonClick(e) {
  e.stopPropagation();
  if (window.innerWidth <= 500) {
        $('.video-editing-popup.expanded').css('max-width', '170px');
  }
  else {
        $('.video-editing-popup.expanded').css('max-width', '200px');
  } 
  $('.slider-wrapper', this.parentElement).toggleClass('visible');
}

function closeButton() {
    $('.slider').removeClass('slider--active');
}

function sliderChange() {
   if(this.classList && !this.classList.contains('slider--active')) {
      this.classList.add('slider--active')
   }
  
  var filterCSS = '';
  $('.slider').each(function(i, elem) {
     
      switch (elem.parentElement.parentElement.classList[0]) {
          case "contrast-slider":
            filterCSS += ' contrast(' + elem.value * 2 + '%)';
            break;
          case "brightness-slider":
            filterCSS += ' brightness(' + elem.value * 2 + '%)';
            break;
          case "invert-slider":
            filterCSS += ' invert(' + elem.value + '%)';
            break;
          case "blur-slider":
            filterCSS += ' blur(' + elem.value/6 + 'px)';
            break;
          case "sepia-slider":
            filterCSS += ' sepia(' + elem.value + '%)';
            break;
          case "grayscale-slider":
            filterCSS += ' grayscale(' + elem.value + '%)';
            break;
      }
  });
  
  document.querySelectorAll('.vid-wrapper video').forEach(function(elem) {
     elem.style.filter = filterCSS;
 }, this);
  //document.body.style.background = 'hsl(201, 100%, ' + (39.6 + (this.value * 0.2)) + '%)';
}

function resetEditing () {
    $('.brightness-slider input, .contrast-slider input').val(50);
    $('.invert-slider input, .blur-slider input, .sepia-slider input, .grayscale-slider input').val(0);
    sliderChange();
}